import React from 'react';

const HomeIcon = ({ size = 40, color = '#fff' }) => (
  <svg width={size} height={size} viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
    <path d="M3 10.5L12 4L21 10.5V20C21 20.5523 20.5523 21 20 21H4C3.44772 21 3 20.5523 3 20V10.5Z" stroke={color} strokeWidth="2" strokeLinejoin="round"/>
    <path d="M9 21V14H15V21" stroke={color} strokeWidth="2" strokeLinejoin="round"/>
  </svg>
);

export default HomeIcon;
